import React from 'react';

const App = () => {
  // Sample data for employees and their tasks
  const employees = [
    { id: 1, name: 'Alice', task: 'Complete project report' },
    { id: 2, name: 'Bob', task: 'Update client presentation' },
    { id: 3, name: 'Charlie', task: 'Prepare for team meeting' },
  ];

  return (
    <div style={{ padding: '20px' }}>
      <h1>Employee Task Table</h1>
      <table style={{ width: '100%', border: '1px solid black', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={{ border: '1px solid black', padding: '8px' }}>Employee Name</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Task</th>
          </tr>
        </thead>
        <tbody>
          {employees.map(employee => (
            <tr key={employee.id}>
              <td style={{ border: '1px solid black', padding: '8px' }}>{employee.name}</td>
              <td style={{ border: '1px solid black', padding: '8px' }}>{employee.task}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
